import React, { useState } from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import { InputAdornment,TextField } from '@mui/material';
import SearchIcon from '@mui/icons-material/Search';
import "./ItemPage.css"

type Item ={
    id:number;
    name:string;
    price:number;
    category:string;
    image:string;
}

const ItemsPage = () => {
const [cart, setCart] = useState<{ item: { id: number; name: string; price: number}; quantity: number}[]> ([]);
const [searchTerm, setSearchTerm] = useState('');
const [categoryFilter, setCategoryFilter] = useState('All'); // default value

const items = [
{ id: 1, name: 'MasalaDosa', price: 50, category: 'vegetarian',image :"data:image/jpeg;base64,"},
{ id: 2, name: 'Idli', price: 30, category: 'vegetarian',image :"https://th.bing.com/th/id/OIP.LrdgB037J2vt1juhWGilPAHaEd?w=279&h=180&c=7&r=0&o=5&dpr=1.5&pid=1.7" },
{ id: 3, name: 'Vada', price: 40, category: 'vegetarian',image :"https://th.bing.com/th/id/OIP.yabCRdby_5QoJ3O1_aVaYAHaFj?w=265&h=199&c=7&r=0&o=5&dpr=1.5&pid=1.7" },
{ id: 4, name: 'Biryani', price: 150, category: 'non-vegetarian',image :"https://th.bing.com/th/id/OIP.YyXYDSLwY-hKarDtEFlc8gHaFj?w=237&h=180&c=7&r=0&o=5&dpr=1.5&pid=1.7" },
{ id: 5, name: 'Chicken Rice', price: 110, category: 'non-vegetarian',image :"https://th.bing.com/th/id/OIP.D-O8P3-LOk1uhIzlTbqViwHaHa?w=193&h=193&c=7&r=0&o=5&dpr=1.5&pid=1.7" },
{ id: 6, name: 'Egg Rice', price: 90, category: 'non-vegetarian',image :"https://th.bing.com/th/id/OIP.ImsN3-UHD3BQoTHUO8-r5gHaEK?w=309&h=180&c=7&r=0&o=5&dpr=1.5&pid=1.7" },
];

const handleAddToCart = (item:any, quantity:number) => {
const updatedCart = [...cart];
const itemIndex = updatedCart.findIndex((cartItem) => cartItem.item.id === item.id);

if (itemIndex > -1) {
// item already in cart, update quantity
updatedCart[itemIndex].quantity += quantity;
if(updatedCart[itemIndex].quantity  < 1){
    updatedCart.splice(itemIndex,1);
}
}
 else if(quantity > 0) {
// item not in cart, add to cart
updatedCart.push({ item, quantity });
}

setCart(updatedCart);
};

const filterItems = (items: Item[], searchTerm: string, categoryFilter: string) => {
    return items.filter((item) => {
    // filter based on search term and category filter
    const isMatchingSearchTerm = item.name.toLowerCase().includes(searchTerm.toLowerCase());
    const isMatchingCategoryFilter = categoryFilter === 'All' || item.category === categoryFilter;
    
    return isMatchingSearchTerm && isMatchingCategoryFilter;
    });
    };
    
    const filteredItems = filterItems(items, searchTerm, categoryFilter);

    function QuantityInput({item,handleAddToCart}) {
      const [isEditing, setIsEditing] = useState(false);
      const [quantity, setQuantity] = useState(cart.find(
        (cartItem) => cartItem.item.id === item.id)?.quantity || 0);

const handleIncrease = () => {
setQuantity(quantity + 1);
handleAddToCart(item, 1);
};

const handleDecrease = () => {
if (quantity > 0) {
setQuantity(quantity - 1);
handleAddToCart(item, -1);
}
};

const handleAdd = () => {
setIsEditing(true);
setQuantity(1);
handleAddToCart(item, 1);
};

const handleQuantityChange = (e) => {
const value = parseInt(e.target.value);
if (isNaN(value) || value < 0) {
setQuantity(0);
} else {
setQuantity(value);
handleAddToCart(item, value - quantity);
}
};

return (
<div className='item'>
{quantity === 0 && (
<button className='add-button' id="add" onClick={handleAdd}>
Add
</button>
)}
{quantity > 0 && (
<div className='add-button'>
<button className='btn' type="button"
onClick={handleDecrease}
>
-
</button>
<input id="field" type="number" min="1" value={quantity} onChange={handleQuantityChange} />
<button className='btn' type="button" onClick={handleIncrease}>
+
</button>
</div>
)}
           </div>
           );
          }
      
    

return (
<div style={{backgroundImage: 'url("data:image/jpeg;base64,")' ,backgroundSize:"cover",backgroundRepeat:"no-repeat"}}>
<div   id="menu">
<p id="shop" >SHOP 1</p>
<h2  >Menu</h2>
<div  id="searchwithfilter">
  <div id="srch">
    <TextField  type="text" id="search" className="form-control" placeholder='Search'
     style={{width:"400px",marginTop:"-30px",marginRight:"500px"}}
     value={searchTerm}
     onChange={(e) => setSearchTerm(e.target.value)}  
     InputProps={{ endAdornment: (
<InputAdornment position="end">
        <SearchIcon />
        </InputAdornment>)
        }}/>
  </div>
  <div  id="filters">
    <label htmlFor="categoryFilter"  id="filter">Filter by category</label>
    <select id="categoryFilter" className="form-select" value={categoryFilter}
      onChange={(e) => setCategoryFilter(e.target.value)}>
      <option value="All">All</option>\
      <option value="vegetarian">Vegetarian</option>
      <option value="non-vegetarian">Non-vegetarian</option>
    </select>
  </div>
 
</div>
<br/>


<div  > 
{filteredItems.map((item) => (
<div  className="contents" key = {item.id}  >
 <div className='item'>
  <br/><hr/>
<img className="item-image" src={item.image} alt ={item.name}/>
<h3  className='item-name'>{item.name}</h3> <br/>
<p className='item-price' >Price: Rs{item.price}</p>
<p  className='item-category'>Category:{item.category}</p> 
<QuantityInput  item={item} handleAddToCart={handleAddToCart} /> <hr/>
</div>
</div>

))}
<div >
<h3 >Cart</h3>
 {cart.map((cartItem) => (
<p key={cartItem.item.id}>
{cartItem.item.name} x {cartItem.quantity}
</p>
))}
<button id="order" type="button"  >Place Order</button>
</div>
</div>
</div>
</div>
);
}

export default ItemsPage;